import { useEffect, useState } from 'react';
import { Link, Route, Routes } from 'react-router-dom';
import './App.css';
import BoardAgent from './components/BoardAgent';
import BoardClient from './components/BoardClient';
import Login from './components/Login';
import Profile from './components/Profile';
import AuthService from './services/auth.service';

function App() {

  const [showAgentBoard, setShowAgentBoard] = useState(false);
  const [showClientBoard, setShowClientBoard] = useState(false);
  const [currentUser, setCurrentUser] = useState(undefined);

  useEffect(() => {
    const user = AuthService.getCurrentUser();
    if(user){
      setCurrentUser(user);
      setShowAgentBoard(user.roles.includes("ROLE_AGENT"));
      setShowClientBoard(user.roles.includes("ROLE_CLIENT"));
    }
  }, [])

  const logout = () => {
    AuthService.logout();
  }
  return (
    <div>
       <nav className="navbar navbar-expand-md navbar-dark bg-dark">

      </nav>
      <div className="container mt-3">
        <Routes>
          <Route path="/login" element={<Login/>} />
          <Route path="/profile" element={<Profile/>} />
          <Route path="/client" element={<BoardClient/>} />
          <Route path="/agent" element={<BoardAgent/>} />
        </Routes>
      </div>
    </div>
  );
}

export default App;
